import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="home">
        <div className="headerContainer">
            <h1>Pizza</h1>
            <p> Pizza to fit any taste</p>
            <button> Order Now</button>
        </div>
    </div>
  )
}

export default Home
